import React, { Component } from "react";
import ImageData from "./../data.json";

import "./SportsPage.css";

class Filter1 extends Component {
  state = {
    sportFilter: ImageData.map(oneImage => {
      if (oneImage.category === "sports") {
        return oneImage;
      }
    })
  };

  handler = evt => {
    const check = evt.target.getAttribute("sports");
    console.log(check);
  };

  //   const women = contactArray.filter(contact => contact.filter === "women");

  //   const other = contactArray.filter(contact => contact.filter === "other");

  render() {
    const { handler } = this;
    return (
      <div className="filter-nav">
        <section className="filter-nav">
          <div onChange={handler} />
        </section>
      </div>
    );
  }
}

export default Filter1;
